  return t.email;
}

function tags(t) {
  return t.tags;
}

function excludedFromLeaderboard(t) {
  return t.excludedFromLeaderboard;
}

function updateInfo(name, excludedFromLeaderboard, title, affiliation, student) {
  return {
          id: student.id,
          name: name,
          avatarUrl: student.avatarUrl,
          email: student.email,
          tags: student.tags,
          excludedFromLeaderboard: excludedFromLeaderboard,
          title: title,
          affiliation: affiliation
        };
}

function make(id, name, avatarUrl, email, tags, excludedFromLeaderboard, title, affiliation) {
  return {
          id: id,
          name: name,
          avatarUrl: avatarUrl,
          email: email,
          tags: tags,
          excludedFromLeaderboard: excludedFromLeaderboard,
          title: title,
          affiliation: affiliation
        };
}

function makeFromJS(studentDetails) {
  return make(studentDetails.id, studentDetails.name, studentDetails.avatarUrl, studentDetails.email, studentDetails.tags, studentDetails.excludedFromLeaderboard, studentDetails.title, studentDetails.affiliation);
}

function update(name, tags, excludedFromLeaderboard, title, affiliation, student) {
  return {
          id: student.id,
          name: name,
          avatarUrl: student.avatarUrl,
          email: student.email,
          tags: tags,
          excludedFromLeaderboard: excludedFromLeaderboard,
          title: title,
          affiliation: affiliation
        };
}

function encode(teamName, t) {
  return Json_encode.object_(/* :: */[
              /* tuple */[
                "id",
                t.id
              ],
              /* :: */[
                /* tuple */[
                  "name",
                  t.name
                ],
                /* :: */[
                  /* tuple */[
                    "team_name",
                    teamName
                  ],
                  /* :: */[
                    /* tuple */[
                      "email",
                      t.email
                    ],
                    /* :: */[
                      /* tuple */[
                        "excluded_from_leaderboard",
                        t.excludedFromLeaderboard
                      ],
                      /* :: */[
                        /* tuple */[
                          "title",
                          t.title
                        ],
                        /* :: */[
                          /* tuple */[
                            "affiliation",
                            OptionUtils.toString(t.affiliation)
                          ],
                          /* [] */0
                        ]
                      ]
                    ]
                  ]
                ]
              ]
            ]);
}

exports.name = name;
exports.avatarUrl = avatarUrl;
exports.id = id;
